import DataTable from 'react-data-table-component';

const columns = [
    {
        name: 'Title',
        selector: row => row.title,
    },
    {
        name: 'Year',
        selector: row => row.year,
        sortable: true,
        // sortFunction: caseInsensitiveSort
    },
];

const data = [
    {
        id: 1,
        title: 'Beetlejuice',
        year: '1988',
    },
    {
        id: 2,
        title: 'Ghostbusters',
        year: '1984',
    },
]

export function Accounts() {
    return (
        <div>
        <DataTable
            columns={columns}
            data={data}
            pagination
        />
        </div>
    );
};
